import React from 'react'

export default function Card(props) {
    return (
        <div>
            <div className="card mt-3" style={{ "width": "300px", "maxHeight": "360px" }}>
                <img src="https://media.istockphoto.com/id/1271641848/video/roasted-turmeric-chicken-top-thai-food-excellent-food-made-from-chicken-4k-video.jpg?s=640x640&k=20&c=n07ITiOdRbfcjjAqnw0yDNTh9jqS8v3v1_Mg3aKPooU=" className="card-img-top" alt="..."  style={{ width: "100%", height: "200px" }}/>
                <div className="card-body">
                    <h5 className="card-title">{props.foodName}</h5>
                    <p className="card-text">This is some Important text</p>
                    <div className='container w-100'>
                        <select className='m-2 h-100 bg-success rounded'>
                            {Array.from(Array(6), (e, i) => {
                                return (
                                    <option key={i + 1} value={i + 1}>{i + 1}</option>
                                )
                            })}
                        </select>
                        <select className='m-2 h-100 bg-success rounded'>
                            <option value="half">Half</option>
                            <option value="full">Full</option>
                        </select>
                        <div className='d-inline h-100 fs-5'>
                            Total Price
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}
